    static boolean checkPalindromeFormation(String a, String b) {
        int i = 0, j = a.length() - 1;
        while (i < j && a.charAt(i) == b.charAt(j)) {
            i++;
            j--;
        }
        if (isPal(a, i, j) || isPal(b, i, j)) return true;

        i = 0;
        j = a.length() - 1;
        while (i < j && b.charAt(i) == a.charAt(j)) {
            i++;
            j--;
        }
        return isPal(a, i, j) || isPal(b, i, j);
    }

    private static boolean isPal(String s, int i, int j) {
        while (i < j && s.charAt(i) == s.charAt(j)) {
            i++;
            j--;
        }
        return i >= j;
    }

    static boolean check(String a, String b) {
        int i = 0, j = a.length() - 1;
        while (i < j && a.charAt(i) == b.charAt(j)) {
            i++;
            j--;
        }
        return isPal(a, i, j) || isPal(b, i, j);
    }


