    static boolean checkPalindromeFormation1(String a, String b) {
        int n = a.length();
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < n; i++) {
            sb.append(a.substring(0, i));
            sb.append(b.substring(i, n));

            if (isPali(sb.toString())) return true;
            sb.setLength(0);
        }

        for (int i = 0; i < n; i++) {
            sb.append(b.substring(0, i));
            sb.append(a.substring(i, n));

            if (isPali(sb.toString())) return true;
            sb.setLength(0);
        }
        return false;
    }

    private static boolean isPali(String s) {
        for (int i = 0; i < s.length() / 2; i++) {
            if (s.charAt(i) != s.charAt(s.length() - i - 1))
                return false;
        }
        return true;
    }
